import {BrowserRouter, Route, Routes} from "react-router-dom";
import Layout from "./Layout";
import Home from "./Home";
import WeeklyLeaderboard from "./WeeklyLeaderboard";
import React, {Component} from "react";
import DailyLeaderBoard from "./DailyLeaderBoard";



class App extends Component {
    state = {
        value: ""
    };


    createUser(){
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({
                userEmail:"TESTTEST@TEST"
            })
        };
        fetch('/api/sudokleQueries/addUser', requestOptions)
            .then(response => response.json());
    };

    handleChange(event) {
        this.setState({value: event.target.value});
    }


    render() {


        return (
            <div>
                <BrowserRouter>
                    <Routes>
                        <Route path="/" element={<Layout/>}>
                            <Route index element={<Home/>} />
                            <Route path="DailyLeaderboard" element={<DailyLeaderBoard/>} />
                            <Route path="WeeklyLeaderboard" element={<WeeklyLeaderboard/>} />
                        </Route>
                    </Routes>
                </BrowserRouter>

                <button id={"test"} onClick={this.createUser}>Add Test User</button>
                <input
                    type="text"
                    value="Enter Email"
                    onChange={this.handleChange}
                />




            </div>

        );
    }
}

export default App;
